import React from 'react'
import Navbar from '../HomePage/Navbar/Navbar'

const NotFound404 = () => {
    return (
        <div>
            <Navbar />
            <div >
                <img style={{border:"5px solid black", margin:"auto",alignContent:"center",alignItems}} src="https://img.freepik.com/free-vector/oops-404-error-with-broken-robot-concept-illustration_114360-1932.jpg?size=626&ext=jpg&ga=GA1.1.348035570.1694454835&semt=ais" alt="" />

            </div>
        </div>
    )
}

export default NotFound404
